import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'
function App() {
  return (
    <Router>
      <ul>
        <li>Home</li>
        <li>Contato</li>

      </ul>
      <Switch>
        <Route exact path='/' element={<Home/>}/>
        <Route path='company'element={<Company/>}/>
        <Route path='contact' element={<Contact/>}/>
        Route
      </Switch>
      <p>Footer</p>
    </Router>
  );
}

export default App;
